import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => setMenuOpen(!menuOpen);

  return (
    <header className="navbar">
      <div className="navbar-left">
        {/* Brand that links to the home page */}
        <Link to="/" className="brand">
          Rycher Funding
        </Link>
        {/* Hamburger button / X toggle */}
        <button className="menu-toggle" onClick={toggleMenu}>
          {menuOpen ? <span className="close-icon">X</span> : <span className="hamburger-icon">&#9776;</span>}
        </button>
      </div>
      {/* Navigation menu that slides in */}
      <nav className={`navbar-menu ${menuOpen ? 'open' : ''}`}>
        <ul>
          <li>
            <Link to="/theidea" onClick={toggleMenu}>The Idea</Link>
          </li>
          <li>
            <Link to="/thecreators" onClick={toggleMenu}>The Creators</Link>
          </li>
          <li>
            <Link to="/thewhy" onClick={toggleMenu}>The Why</Link>
          </li>
          <li>
            <Link to="/theapps" onClick={toggleMenu}>The Apps</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
